"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\" rowspan=\"1\">",
"        General instructions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\" rowspan=\"1\">",
"        Focus on stretching after exercise, when the muscle-tendon units are warm and elasticity is increased, compared to stretching before exercise when the muscle-tendon units are cold, and less elastic.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\" rowspan=\"1\">",
"        Ice after exercise.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\" rowspan=\"1\">",
"        Do not do isometric or other restrengthening exercises immediately before walking or running.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\" rowspan=\"1\">",
"        If you have pain at any point during the program, rest a day, then start again on the previous level.",
"       </td>",
