var title_f15_18_15661="Moderate and severe alcohol withdrawal - Rapid overview";
var content_f15_18_15661=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F64745&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F64745&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Moderate and severe alcohol withdrawal: Rapid overview",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <span style=\"color: #ff0000;\">",
"         To obtain emergent consultation with a medical toxicologist, call the United States Poison Control Network at 1-800-222-1222, or access the World Health Organization's list of international poison centers (",
"        </span>",
"        <a href=\"file://www.who.int/gho/phe/chemical_safety/poisons_centres/en/index.html\" target=\"_blank\">",
"         www.who.int/gho/phe/chemical_safety/poisons_centres/en/index.html",
"        </a>",
"        <span style=\"color: #ff0000;\">",
"         ).",
"        </span>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Syndromes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Alcohol tremulousness - occurs early, characterized by hypertension, tachycardia, tremors, and anxiety, with normal mental status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Alcohol withdrawal seizures - occurs early, usually single or brief flurry of seizures with short post-ictal period",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Alcoholic hallucinosis - occurs early, no evidence of autonomic instability",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Delirium tremens - occurs late, characterized by delirium and autonomic instability",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        History",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pattern of alcohol use, history of withdrawal symptoms; inquire about reasons for cessation of alcohol",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Physical examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vital signs, mental status, presence of tremor; examine for signs of trauma, abdominal tenderness, other findings consistent with complications of chronic alcohol use",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Laboratory testing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No test truly assesses withdrawal; ancillary data (eg, serum ethanol concentration, lumbar puncture (CSF), head CT, lipase) frequently needed to assess patient and rule out coexistent illness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Benzodiazepines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        First line therapy for ALL alcohol withdrawal syndromes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Most patients with symptoms require IV therapy initially",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <strong>",
"         Give:",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Diazepam, 5 to 10 mg IV, repeat every 5 to 10 minutes,",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Lorazepam, 2 to 4 mg IV, repeat every 15 to 20 minutes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Massive doses (&gt;2000 mg diazepam in 48 hours) may be required",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Clinically stable patients with minimal symptoms may be treated with oral medications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Barbiturates",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Synergistic with benzodiazepines; give if patient refractory to high-dose benzodiazepines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Phenobarbital 130 to 260 mg IV, repeat every 15 to 20 minutes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Intubation frequently required with concurrent benzodiazepine and barbiturate use",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        ALL patients requiring barbiturates are monitored in an intensive care unit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Propofol",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Excellent agent if patient refractory to benzodiazepines and barbiturates",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Intubation almost always required",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 mg/kg IV push as induction agent for intubation; titrate continuous infusion for sedation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Supportive care",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Assure adequate fluid and electrolyte replacement",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Give parenteral thiamine 100 mg and glucose daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Give multivitamin supplements",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ensure adequate caloric support",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
